class LoginComponent {
    constructor(router, userService, data, validatorService) {
        this.router = router;
        this.userService = userService;
        this.data = data;
        this.validatorService = validatorService;
        this.username = '';
        this.password = '';
    }
    ngOnInit() {
        this.data.postaviKorisnika({
            id: 0,
            AT: 0,
            ime: '',
            prezime: ' ',
            slika: '',
            korisnickoIme: '',
            lozinka: '',
            datumRodjenja: '',
            grad: '',
            drzava: '',
            email: '',
            procitaneKnjige: [],
            citamKnjige: [],
            zaCitanjeKnjige: []
        });
    }
    login() {
        var userFound = false;
        if (this.validatorService.validateUsername(this.username) && this.validatorService.validatePassword(this.password)) {
            userFound = this.userService.korisnikLogIn(this.username, this.password);
        }
        if (userFound) {
            this.router.navigate(['/home']);
        }
        console.log('login button clicked');
    }
    changePassword() {
        this.router.navigate(['/change/password']);
    }
    register() {
        this.router.navigate(['/register']);
        console.log('register button clicked');
    }
    guest() {
        this.router.navigate(['/home']);
        console.log('guest entry');
    }
}
